import React from 'react';
import axiosRequests from '../classes/axiosRequests';

const NewsPage = () => {

    return (
        <div>
            News Page
        </div>
    );
};

export const NewsPageLoader = async () => {
    axiosRequests.GET('/api/news')
    .then(response => {
        return response
    })
    .catch(e => console.log(e))
}

export default NewsPage;
